import React from "react";
import "./Contact.css";

const ContactFrom = () => {
  return (
    <>
      <section className="contact mtop">
        <div className="container flex">
            <div className="main-content">
                <h2>Contact From</h2>
                <p>Fill out the form be</p>
            </div>
        </div>
      </section>
    </>
  );
};

export default ContactFrom;
